ements\":[{\"x\":1.0893246187364,\"y\":68.774193548387,\"width\":97.276688453159,\"height\":30.752688172043,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The pure substance can be in one or more physical states such as: the solid state, the liquid state and the gaseous state. The transition from one physical state to another is a <strong>physical change</strong>. During physical change, the identity of the substance does not change.</p>\\n\\n<p>Separation techniques involve physical change only. So during distillation, pure water passes from liquid state to gaseous state and then again to liquid state, but the particles of water do not change their chemical structure.</p>\\n\"},\"subContentId\":\"92e38454-658f-433c-8e8e-27e3d384aebf\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.2391573729864,\"y\":2.4449877750611,\"width\":96.456009913259,\"height\":11.833740831296,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Pure substances cannot be separated into simpler substances by applying physical separation techniques, such as filtration and distillation.</strong></p>\\n\"},\"subContentId\":\"f8f3797b-59a5-4cde-a3ba-493ad337fe61\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":6.9751301733668605,\"y\":10.333709939651134,\"width\":83.1972649382209,\"height\":58.567334453966765,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/png;base64,iVBORw0KGg ext\":\"<p><span style=\\\"font-size:0.75em\\\"><em>A little bit of salt (or acid) is added to pure water to allow the conduction of electricity. </em></span></p>\\n\"},\"subContentId\":\"fcf9331d-dee8-4a0c-a5ec-43064528eccf\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.0962111653492035,\"y\":32.480398079758864,\"width\":61.764705882353,\"height\":44.731182795699,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>For example by <strong>electrolysis,</strong> water can be decomposed into its basic constituents: <strong>hydrogen</strong> and <strong>oxygen</strong> gases.</p>\\n\\n<p>Since water can be broken down into simpler substances, it is called a <strong>compound.</strong></p>\\n\\n<p>Oxygen and hydrogen cannot be broken down into simpler substances. They are <strong>elements. </strong></p>\\n\"},\"subContentId\":\"65a38f1b-6180-4227-ab5d-983b221c9ddd\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.50324480138116,\"y\":17.820142507895355,\"width\":62.591745190052656,\"height\":15.222179204983425,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Other techniques involving chemical reactions are applied to decompose pure substances into their basic constituents.</p>\\n\"},\"subContentId\":\"72998d31-ae41-41ab-b9c6-0d6bde440569\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}]},{\"elements\":[{\"x\":1.1152416356877,\"y\":2.4368386308068,\"width\":98.686493184634,\"height\":19.168704156479,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>An <strong>element</strong> is a pure substance that cannot be broken down into simpler substances by chemical reactions.</p>\\n\\n<p>A <strong>compound </strong>is a pure substance that can be broken down into 2 or more simpler substances by chemical reactions.</p>\\n\"},\"subContentId\":\"d9103436-4544-485f-be8f-075f9e39ce53\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.421568627451,\"y\":28.05376344086,\"width\":97.821350762527,\"height\":61.935483870968,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Elements include: </p>\\n\\n<ul>\\n\\t<li>Oxygen and nitrogen that are present in air.</li>\\n\\t<li>Mercury that is used in thermometers, barometers and dental amalgams for filling teeth.</li>\\n\\t<li>Helium that is used to fill balloons and in mixtures with oxygen for deep sea diving.</li>\\n\\t<li>Gold which is a very rare element and is used for making jewels and coins. </li>\\n</ul>\\n\"},\"subContentId\":\"54fbd158-ef1e-4f58-acaa-0108dee817d8\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.4224751066856,\"y\":2.8089887640449,\"width\":66.716232961586,\"height\":6.9437652811736,\"action\":{ },{\"elements\":[{\"x\":1.4224751066856,\"y\":2.8089887640449,\"width\":20.86741016109,\"height\":6.9437652811736,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Metals and non-metals</strong></p>\\n\"},\"subContentId\":\"dbc87ed3-6416-415e-a2dc-da06ec77636f\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4161220043573,\"y\":17.193548387097,\"width\":97.712418300654,\"height\":82.150537634409,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Metals</strong> are very numerous in nature. Following are some of their major characteristic properties.</p>\\n\\n<ul>\\n\\t<li>Metals are <span style=\\\"color:#c0392b\\\"><strong>solids</strong></span> at room temperature except for mercury which is liquid at room temperature.</li>\\n\\t<li>Metals are <span style=\\\"color:#c0392b\\\"><strong>lustrous</strong></span> (shiny), when polished or freshly cut.</li>\\n\\t<li>Metals have<strong><span style=\\\"color:#c0392b\\\"> high melting points </span></strong>(with some exceptions like gallium that has a melting point of 29.8°C).</li>\\n\\t<li>Metals are <strong><span style=\\\"color:#c0392b\\\">hard </span></strong>(with some exceptions like sodium and pure gold which are soft. To be used in jewelry making, gold has to be mixed with other metals).</li>\\n\\t<li>Metals are good <span style=\\\"color:#c0392b\\\"><strong>conductors</strong></span> of heat and electricity.</li>\\n\\t<li>Metals have relatively <strong><span style=\\\"color:#c0392b\\\">high densities</span></strong>.</li>\\n\\t<li>Metals are<span style=\\\"color:#c0392b\\\"><strong> malleable</strong></span><strong>;</strong><span style=\\\"color:#c0392b\\\"><strong> </strong></span>they can be hammered or beaten into thin sheets.</li>\\n\\t<li>Metals are <span style=\\\"color:#c0392b\\\"><strong>ductile</strong></span><strong>;</strong> they can be drawn into thin wires.</li>\\n</ul>\\n\"},\"subContentId\":\"6e223f95-f5af-420a-830e-7f61c17a17a1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4224751066856,\"y\":8.4269662921348,\"width\":95.216852540273,\"height\":6.9437652811736,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>In general, elements can be metals or non-metals. Some elements are semi-metals or metalloids.</p>\\n\"},\"subContentId\":\"e970ece2-df2a-46f8-b9ea-309fde711e47\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.419172932330827,\"y\":14.04436576208355,\"width\":96.59308270676692,\"height\":74.25977852763651,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Characteristic properties of non-metals</p>\\n\\n<ul>\\n\\t<li>They are <span style=\\\"color:#c0392b\\\"><strong>dull</strong></span><strong>;</strong> they do not have luster.</li>\\n\\t<li>Many non-metals are <span style=\\\"color:#c0392b\\\"><strong>gases</strong></span> at room temperature. Some are <span style=\\\"color:#c0392b\\\"><strong>solids </strong></span>like iodine, and only one non-metal is <strong><span style=\\\"color:#c0392b\\\">liquid</span>:<span style=\\\"color:#c0392b\\\"> </span></strong>bromine.</li>\\n\\t<li><span>Solid non-metals are </span><strong><span style=\\\"color:#c0392b\\\">brittle</span></strong><span>. This means that they break easily.</span></li>\\n\\t<li><span>They are </span><span style=\\\"color:#c0392b\\\"><strong>not malleable</strong></span><span>. They cannot be hammered into different shapes. </span></li>\\n\\t<li>They are <span style=\\\"color:#c0392b\\\"><strong>not ductile</strong></span>. They cannot be drawn into wires.</li>\\n\\t<li>They are <span style=\\\"color:#c0392b\\\"><strong>poor conductors</strong></span> of heat and electricity.</li>\\n\\t<li>In general, they have <span style=\\\"color:#c0392b\\\"><strong>low melting and boiling points</strong></span>. </li>\\n</ul>\\n\\n<p> </p>\\n\"},\"subContentId\":\"514de70c-0e0a-4dbf-85aa-ac4510df7fe8\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4224751066856,\"y\":5.6179775280899,\"width\":40.113798008535,\"height\":6.1797752808989,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Non-metals</strong></p>\\n\"},\"subContentId\":\"aee863e7-affc-4d4d-995e-08f6303d296c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":1.4224751066856,\"y\":5.6179775280899,\"width\":40.113798008535,\"height\":6.1797752808989,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>Semi-metals or Metalloids</strong></p>\\n\"},\"subContentId\":\"f5bb7739-835b-4dc5-a4c8-85e0a59469f0\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":1.4224751066856,\"y\":14.044943820225,\"width\":72.119487908962,\"height\":6.1797752808989,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Their properties are intermediate between metallic and non-metallic properties.</p>\\n\"},\"subContentId\":\"84786728-5bbd-462e-a9d3-33a273330aae\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":11.379800853485,\"y\":30.898876404494,\"width\":20.250088594138,\"height\":40,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEASABIAAD/4ZJrRXhpZgAASUkqAAgAAAAMAA4BAgAJAAAAngAAAA8BAgAGAAAAqAAAABABAgAKAAAArgAAABIBAwABAAAAAQAAABoBBQABAAAAuAAAABsBBQABAAAAwAAAACgBAwABAAAAAgAAADEBAgALAAAAyAAAADIBAgAUAAAA1AAAABMCAwABAAAAAgAAAGmHBAABAAAAZAEAAKXEBwB8AAAA6AAAAFR3AABTT05ZIERTQwAAU09OWSAARFNMUi1BMzAwAEgAAAABAAAASAAAAAEAAABHSU1QIDIuNi4yAAAyMDA5OjA3OjIxIDExOjQ5OjA0AFByaW50SU0AMDMwMAAABgABABYAFgACAAEAAAADADQAAAAAAQUAAAABAQAAAAAQAYAAAAAJEQAAECcAAAsPAAAQJwAAlwUAABAnAACwCAAAECcAAAEcAAAQJwAAXgIAABAnAACLAAAAECcAAMsDAAAQJwAA5RsAABAnAAAhAJqCBQABAAAA9gIAAJ2CBQABAAAA/gIAACKIAwABAAAAAgAAACeIAwABAAAAZAAAAACQBwAEAAAAMDIyMQOQAgAUAAAABgMAAASQAgAUAAAAGgMAAAGRBwAEAAAAAQIDAAKRBQABAAAALgMAAAOSCgABAAAANgMAAASSCgABAAAAPgMAAAWSBQABAAAARgMAAAeSAwABAAAABQAAAAiSAwABAAAAAAAAAAmSAwABAAAAEAAAAAqSBQABAAAATgMAAHySBwCgcwAAVgMAAIaSBwBAAAAA9nYAAACgBwAEAAAAMDEwMAGgAwABAAAAAQAAAAKgBAABAAAAtAMAAAOgBAABAAAAtAMAAAWgBAABAAAANncAAACjBwABAAAAAwAAAAGjBwABAAAAAQAAAAGkAwABAAAAAAAAAAKkAwABAAAAAAAAAAOkAwABAAAAAAAAA
